import React, { Component } from 'react';

import json from './emoji.json';

function search_emoji(query){
	return function(x){
		return x.keyword.toLowerCase() ;
	}
}
class typeemo extends Component {
	constructor(props) {
		super(props);

		this.state = {jsondata:json,query:'' };
	}
	render() {
		const emojiList = this.state.jsondata.filter(search_emoji(this.query)).map(shareholder => (
			<div className="shareholder">
				{shareholder.symbol}
				{shareholder.title}
			</div>
		));
		return <h1>{emojiList}</h1>;
	}
}

export default typeemo;
